//images.obi.de/product/AT/1500x1500/613813_2.jpg","name":"Biohort Hochbeet Metall Quarzgrau-Metallic 77 cm x 201 cm x 102 cm","width":1500,"height":1500,"description":"Das Biohort Hochbeet aus Metall in der Farbe Quarzgrau-Metallic ist ein modernes Hochbeet zum Anbau von Kräutern, Gemüse oder anderen Nutz- und Zierpflanzen auf Ihrer Terrasse oder im Garten. Das Metall-Hochbeet vereint edles Design mit perfekter Funktionalität und ist dabei einfach im Aufbau. Durchdachtes Hochbeet: robust, rückenfreundlich und einfach zu entleeren Das Metall-Hochbeet bietet eine komfortable und vor allem rückenfreundliche Arbeitshöhe von 77 cm. Dank des aufrechten Gärtnerns werden auch Ihre Kniegelenke geschont. Zum Entleeren oder Befüllen müssen Sie lediglich die Seitenelemente öffnen und den Inhalt entfernen. Das spart Zeit, Kraft und Energie. Durch die spezielle Konstruktion mit Hohlkammerprofilen halten die Seitenteile auch hohen Kräften zuverlässig stand und sind somit äußerst langlebig.  Optimales Klima Ein Garten-Hochbeet bietet aufgrund der guten Nährstoffversorgung ideale Wachstumsbedingungen für Ihre Pflanzen. Die Hohlkammerprofile tragen ebenfalls dazu bei. Dank der Luftkammern wird die Innenseite des Hochbeetes nicht so heiß wie die Außenseite, wodurch die Erde vor schnellem Austrocknen geschützt wird.  Schneller Aufbau Der Aufbau ist durch die robusten Alu-Strangpress- Eckenelemente mit integrierter Führungsschiene von nur einer Person in weniger als 10 Minuten zu erledigen. Schieben Sie einfach die T-Profile der Seitenteil-Kanten in die Schiene und fixieren diese mit der Eckabdeckung. Eine beigefügte bebilderte Anleitung vereinfacht Ihnen den Aufbau zusätzlich. Schicht für Schicht optimal anordnen Für eine ertragreiche Ernte ist die richtige Zusammensetzung Ihres Hochbeetes enorm wichtig. Idealerweise besteht die unterste Schicht aus Zweigen oder Ästen, die folgende Schicht aus Rasenstücken, dann eine Schicht aus verrottetem Laub oder kleineren Gartenabfällen. Die vorletzte Schicht sollte sich aus Gartenerde und halbreifem Kompost zusammensetzen. Den Abschluss bildet die letzte Schicht aus hochwertiger Blumen-, Pflanz- oder Kräutererde. So schaffen Sie optimale Wachstumsbedingungen im Kräuter-, Pflanz- oder Gemüsehochbeet für Ihre Pflanzen."},{"@context":"http://schema.org","@type":"ImageObject","url":"https://images.obi.de/product/AT/1500x1500/613813_3.jpg","name":"Biohort Hochbeet Metall Quarzgrau-Metallic 77 cm x 201 cm x 102 cm","width":1500,"height":1500},{"@context":"http://schema.org","@type":"ImageObject","url":"https://images.obi.de/product/HU/800x600/411667_2.jpg","name":"Biohort Hochbeet Metall Quarzgrau-Metallic 77 cm x 201 cm x 102 cm","width":800,"height":600},{"@context":"http://schema.org","@type":"ImageObject","url":"https://images.obi.de/product/HU/800x600/411667_4.jpg","name":"Biohort Hochbeet Metall Quarzgrau-Metallic 77 cm x 201 cm x 102 cm","width":800,"height":600},{"@context":"http://schema.org","@type":"ImageObject","url":"https://images.obi.de/product/HU/800x600/411667_5.jpg","name":"Biohort Hochbeet Metall Quarzgrau-Metallic 77 cm x 201 cm x 102 cm","width":800,"height":600},{"@context":"http://schema.org","@type":"ImageObject","url":"https://images.obi.de/product/HU/800x600/411667_6.jpg","name":"Biohort Hochbeet Metall Quarzgrau-Metallic 77 cm x 201 cm x 102 cm","width":800,"height":600}],"localThumb":"biohort-hochbeet-metall-quarzgrau-metallic-77-cm-x-201-cm-x-102-cm-biohort-2591022.jpg","price":"599.99","reviewCount":413,"stars":4,"shopLink":"https://www.obi.de/metall-hochbeete/biohort-hochbeet-metall-quarzgrau-metallic-77-cm-x-201-cm-x-102-cm/p/2591022","localThumbs":["biohort-hochbeet-metall-quarzgrau-metallic-77-cm-x-201-cm-x-102-cm-biohort-2591022-1.jpg","biohort-hochbeet-metall-quarzgrau-metallic-77-cm-x-201-cm-x-102-cm-biohort-2591022-2.jpg","biohort-hochbeet-metall-quarzgrau-metallic-77-cm-x-201-cm-x-102-cm-biohort-2591022-3.jpg","biohort-hochbeet-metall-quarzgrau-metallic-77-cm-x-201-cm-x-102